        <div className="box2">
          Bespoke products & platforms engineered to elevate your customers' experience, earn their loyalty & grow your business.
        </div>
        <div className="box3">
          <div className="box4">
            Explore Services
        </div>
        </div>

        <div className = "backimg">

        </div>
        </div>

      
      <style jsx>{`
  .box {
    position: absolute;
    width: 1300px;
    height: 630px;
