    height: 345px;
    left: 85px;
    top: 205px;
    font-family: Roboto;
    font-style: normal;
    font-weight: bold;
    font-size: 90px;
    line-height: 105px;   
    color: #333333;
  }
.box2 {
    position: absolute;
    width: 411px;
    height: 266px;
    left: 754px;
    top: 205px;
    font-family: Roboto;
    font-style: normal;
    font-weight: 300;
    font-size: 36px;
    line-height: 42px;
    color: #222222;
  }

.box3 {
    position: absolute;
    width: 194px;
    height: 50px;
    left: 756px;
    top: 504px;
    background: #FFFFFF;
    border: 2px solid #184A88;
    box-sizing: border-box;
    border-radius: 4px;
} 

.box4 {
    position: absolute;
    width: 118px;
    height: 19px;
    left: 39px;
    top: 13px;
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 16px;
    line-height: 19px;
    color: #184A88;
}

  .backimg {
    position: absolute;
    width: 1300px;
    height: 859px;
    left: 0px;
    top: 791px;
    
  }
  `}</style>
    </div>
  )
}
